import React from 'react';
import Square from './square'; 



function Board ({squares,onClick}) {

const renderSquare=(i)=>{
        return <Square value={squares[i]}
        onClick={()=>onClick(i)}
        />
    }

  return(
  <div>
                <div className="row">
                    {renderSquare(0)}
                    {renderSquare(1)}
                    {renderSquare(2)}
                </div>
                <div className="row">
                    {renderSquare(3)}
                    {renderSquare(4)}
                    {renderSquare(5)}
                </div>
                <div className="row">
                    {renderSquare(6)}
                    {renderSquare(7)}
                    {renderSquare(8)}
                </div>
            </div>
    )
}

export default Board;
